import styled from 'styled-components'

const Sidebar = ({ className, children, header }) => (
  <SidebarStyles className={className}>
      <h1>{header}</h1>
    {children}
  </SidebarStyles>
);

const SidebarStyles = styled('div')`
  background: var(--purple300);
  width: 70px;
  height: 100vh;
`;

export default Sidebar;
